import React from "react";
import {Link} from "react-router-dom";
function Feedback() {
  return (
    <>
      <textarea
        className="textarea"
        rows="10"
        cols="50"
        placeholder="Enter your feedback"
      />
      <div>
        <Link to="/city" >
          <button type="submit" className="ticket-button" style={{marginLeft:"650px"}}>
            submit
          </button>
        </Link>
      </div>
    </>
  );
}

export default Feedback;
